description:
College student Natsuka has been one-sidedly in love with his best friend from senior high, Hakushima, for 4 years. So as not to stain the dazzling and perfect Hakushima, he's unable to confess. To suppress these explosive feelings, he embraces his sex friend, Seno, as a substitute for Hakushima. One day, Seno accidentally runs over Hakushima while on his motorcycle, and Hakushima is left unconscious. Afterwards, Seno wakes up, saying: &quot;I am Hakushima.&quot;

Natsuka thought that by embracing his sex friend, who is now housing his beloved Hakushima's soul: &quot;I can touch Hakushima.&quot;

Is it the soul or the body that you love? A body-swap love triangle story.

